=\"\u0416\u043e\u0437\u0435\u0444\u0438\u043d\u0430 \u0411\u043e\u0433\u0430\u0440\u043d\u0435\">\u0416\u043e\u0437\u0435\u0444\u0438\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1840_%D0%B3%D0%BE%D0%B4\" title=\"1840 \u0433\u043e\u0434\">1840<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0430 \u0442.&#160;\u043d. <a href=\"https:\/\/en.wikipedia.org\/wiki\/Uniform_Penny_Post\" class=\"extiw\" title=\"en:Uniform Penny Post\">\u0415\u0434\u0438\u043d\u0430\u044f \u0413\u0440\u043e\u0448\u043e\u0432\u0430\u044f \u043f\u043e\u0447\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%95%D0%B4%D0%B8%D0%BD%D0%B0%D1%8F_%D0%93%D1%80%D0%BE%D1%88%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0415\u0434\u0438\u043d\u0430\u044f \u0413\u0440\u043e\u0448\u043e\u0432\u0430\u044f \u043f\u043e\u0447\u0442\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0440\u0443\u0441\u0441\u043a.<\/a>, \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0430\u044f \u0446\u0435\u043d\u0443 \u0437\u0430 \u043e\u0442\u043f\u0440\u0430\u0432\u043a\u0443 \u043f\u0438\u0441\u0435\u043c \u0432 \u043e\u0434\u0438\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D0%BD%D0%BD%D0%B8\" title=\"\u041f\u0435\u043d\u043d\u0438\">\u043f\u0435\u043d\u043d\u0438<\/a> \u0438 \u0440\u0435\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u0432\u0448\u0430\u044f \u043f\u043e\u0447\u0442\u043e\u0432\u0443\u044e \u0441\u0438\u0441\u0442\u0435\u043c\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1861_%D0%B3%D0%BE%D0%B4\" title=\"1861 \u0433\u043e\u0434\">1861<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D1%86%D0%B5%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0421\u0435\u0446\u0435\u0441\u0441\u0438\u044f\">\u0441\u0435\u0446\u0435\u0441\u0441\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%BB%D0%BE%D1%80%D0%B8%D0%B4%D0%B0\" title=\"\u0424\u043b\u043e\u0440\u0438\u0434\u0430\">\u0424\u043b\u043e\u0440\u0438\u0434\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1863_%D0%B3%D0%BE%D0%B4\" title=\"1863 \u0433\u043e\u0434\">1863<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0437\u0430\u043f\u0443\u0449\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u043c\u0438\u0440\u0435 \u043b\u0438\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D0%BD\" title=\"\u041c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\">\u043c\u0435\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0435\u043d\u0430<\/a> (3,6 \u043a\u043c).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1878_%D0%B3%D0%BE%D0%B4\" title=\"1878 \u0433\u043e\u0434\">1878<\/a>&#160;\u2014 \u043e\u0434\u0435\u0440\u0436\u0430\u043d\u0430 \u043f\u043e\u0431\u0435\u0434\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 \u0432\u043e\u0439\u0441\u043a \u0438 \u0431\u043e\u043b\u0433\u0430\u0440 \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B8%D0%BF%D0%BA%D0%B0_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)\" title=\"\u0428\u0438\u043f\u043a\u0430 (\u0433\u043e\u0440\u043e\u0434)\">\u0428\u0438\u043f\u043a\u043e\u0439<\/a> \u043d\u0430\u0434 30-\u0442\u044b\u0441\u044f\u0447\u043d\u043e\u0439 \u0442\u0443\u0440\u0435\u0446\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0435\u0439 \u0412\u0435\u0441\u0438\u043b\u044c-\u043f\u0430\u0448\u0438.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916\" class=\"mw-redirect\" title=\"1916\">1916<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D1%80%D0%B7%D1%83%D1%80%D1%83%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u042d\u0440\u0437\u0443\u0440\u0443\u043c\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u042d\u0440\u0437\u0443\u0440\u0443\u043c\u0441\u043a\u043e\u0433\u043e \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u044f<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0432\u043e\u0439\u0441\u043a\u0430 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%B4%D0%B5%D0%BD%D0%B8%D1%87,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u042e\u0434\u0435\u043d\u0438\u0447, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u042e\u0434\u0435\u043d\u0438\u0447\u0430<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/3-%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F_(%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F)\" title=\"3-\u044f \u0430\u0440\u043c\u0438\u044f (\u041e\u0441\u043c\u0430\u043d\u0441\u043a\u0430\u044f \u0438\u043c\u043f\u0435\u0440\u0438\u044f)\">3-\u044e \u0442\u0443\u0440\u0435\u0446\u043a\u0443\u044e \u0430\u0440\u043c\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u043d\u0430 \u043f\u0435\u0440\u0432\u043e\u043c \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041b\u0438\u0433\u0430 \u041d\u0430\u0446\u0438\u0439\">\u041b\u0438\u0433\u0438 \u041d\u0430\u0446\u0438\u0439<\/a> \u0440\u0430\u0442\u0438\u0444\u0438\u0446\u0438\u0440\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D1%80%D1%81%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0412\u0435\u0440\u0441\u0430\u043b\u044c\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u043e\u043a\u043e\u043d\u0447\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u0443\u044e \u043c\u0438\u0440\u043e\u0432\u0443\u044e \u0432\u043e\u0439\u043d\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1946_%D0%B3%D0%BE%D0%B4\" title=\"1946 \u0433\u043e\u0434\">1946<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u043e\u0435 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%90%D1%81%D1%81%D0%B0%D0%BC%D0%B1%D0%BB%D0%B5%D1%8F_%D0%9E%D0%9E%D0%9D\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u0410\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u044f \u041e\u041e\u041d\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b\u044c\u043d\u043e\u0439 \u0410\u0441\u0441\u0430\u043c\u0431\u043b\u0435\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B3%D0%B0%D0%BD%D0%B8%D0%B7%D0%B0%D1%86%D0%B8%D1%8F_%D0%9E%D0%B1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u041e\u0431\u044a\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u041d\u0430\u0446\u0438\u0439\">\u041e\u041e\u041d<\/a> \u0432 \u041b\u043e\u043d\u0434\u043e\u043d\u0435 (Westminster Central Hall), \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043e 51 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_de_Havilland_Comet_%D0%B2%D0%BE%D0%B7%D0%BB%D0%B5_%D0%AD%D0%BB%D1%8C%D0%B1%D1%8B\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 de Havilland Comet \u0432\u043e\u0437\u043b\u0435 \u042d\u043b\u044c\u0431\u044b\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432 \u043c\u0438\u0440\u0435 \u0440\u0435\u0430\u043a\u0442\u0438\u0432\u043d\u043e\u0433\u043e \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u0433\u043e \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430<\/a> \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D1%8C%D0%B1%D0%B0_(%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B2)\" title=\"\u042d\u043b\u044c\u0431\u0430 (\u043e\u0441\u0442\u0440\u043e\u0432)\">\u043e\u0441\u0442\u0440\u043e\u0432\u0430 \u042d\u043b\u044c\u0431\u0430<\/a> (\u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0432 \u0432\u043e\u0437\u0434\u0443\u0445\u0435). \u041f\u043e\u0433\u0438\u0431\u043b\u0438 35 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1962_%D0%B3%D0%BE%D0%B4\" title=\"1962 \u0433\u043e\u0434\">1962<\/a>&#160;\u2014 \u0432\u0435\u043b\u0438\u0447\u0430\u0439\u0448\u0430\u044f \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043b\u0430\u0432\u0438\u043d \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430: \u043e\u0431\u0432\u0430\u043b \u0441 \u041d\u0435\u0432\u0430\u0434\u043e-\u0423\u0430\u0441\u043a\u0430\u0440\u0430\u043d (\u041f\u0435\u0440\u0443). \u041e\u0431\u044a\u0451\u043c \u043c\u0430\u0441\u0441\u044b \u0441\u043d\u0435\u0433\u0430 \u0438 \u043b\u044c\u0434\u0430 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u043e 3&#160;\u043c\u043b\u043d \u043a\u0443\u0431\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u043c\u0435\u0442\u0440\u043e\u0432, \u0430 \u043a \u043a\u043e\u043d\u0446\u0443 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f \u0434\u043e\u0441\u0442\u0438\u0433 10&#160;\u043c\u043b\u043d \u043a\u0443\u0431\u043e\u043c\u0435\u0442\u0440\u043e\u0432. \u041b\u0430\u0432\u0438\u043d\u0430 \u0437\u0430 7 \u043c\u0438\u043d. \u0441\u0442\u0451\u0440\u043b\u0430 \u0441 \u043b\u0438\u0446\u0430 \u0437\u0435\u043c\u043b\u0438 \u0433\u043e\u0440\u043e\u0434\u043e\u043a \u0420\u0430\u043d\u0440\u0430\u0438\u0440\u043a\u0430, 6 \u043c\u0435\u043d\u044c\u0448\u0438\u0445 \u043f\u043e\u0441\u0435\u043b\u0435\u043d\u0438\u0439 \u0438 \u0447\u0430\u0441\u0442\u0438\u0447\u043d\u043e \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u043b\u0430 \u0435\u0449\u0451 \u0442\u0440\u0438. \u0422\u043e\u0447\u043d\u043e\u0435 \u0447\u0438\u0441\u043b\u043e \u0436\u0435\u0440\u0442\u0432 \u043d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e. \u041f\u043e \u043f\u0440\u0438\u0431\u043b\u0438\u0437\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u043f\u043e\u0434\u0441\u0447\u0451\u0442\u0430\u043c \u043f\u043e\u0433\u0438\u0431\u043b\u043e 4 \u0442\u044b\u0441. \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u0438 10 \u0442\u044b\u0441. \u0433\u043e\u043b\u043e\u0432 \u0434\u043e\u043c\u0430\u0448\u043d\u0438\u0445 \u0436\u0438\u0432\u043e\u0442\u043d\u044b\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE%D0%B4\" title=\"1989 \u0433\u043e\u0434\">1989<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u0432\u044b\u0432\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u043a\u0443\u0431\u0438\u043d\u0441\u043a\u0438\u0445<\/a> \u0432\u043e\u0439\u0441\u043a \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BE%D0%BB%D0%B0\" title=\"\u0410\u043d\u0433\u043e\u043b\u0430\">\u0410\u043d\u0433\u043e\u043b\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 \u0431\u0430\u043d\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B4%D1%83%D0%B5%D0%B2,_%D0%A1%D0%B0%D0%BB%D0%BC%D0%B0%D0%BD_%D0%91%D0%B5%D1%82%D1%8B%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0430\u0434\u0443\u0435\u0432, \u0421\u0430\u043b\u043c\u0430\u043d \u0411\u0435\u0442\u044b\u0440\u043e\u0432\u0438\u0447\">\u0421\u0430\u043b\u043c\u0430\u043d\u0430 \u0420\u0430\u0434\u0443\u0435\u0432\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D1%80%D0%B0%D0%BF%D0%B8%D0%BB%D0%BE%D0%B2,_%D0%A5%D1%83%D0%BD%D0%BA%D0%B0%D1%80-%D0%9F%D0%B0%D1%88%D0%B0_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0418\u0441\u0440\u0430\u043f\u0438\u043b\u043e\u0432, \u0425\u0443\u043d\u043a\u0430\u0440-\u041f\u0430\u0448\u0430 \u0413\u0435\u0440\u043c\u0430\u043d\u043e\u0432\u0438\u0447\">\u0425\u0443\u043d\u043a\u0430\u0440\u0430 \u0418\u0441\u0440\u0430\u043f\u0438\u043b\u043e\u0432\u0430<\/a> \u0432\u0442\u043e\u0440\u0433\u043b\u0430\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%B3%D0%B5%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d\">\u0414\u0430\u0433\u0435\u0441\u0442\u0430\u043d<\/a> \u0438 \u043d\u0430\u043d\u0435\u0441\u043b\u0430 \u0443\u0434\u0430\u0440 \u043f\u043e \u0432\u0435\u0440\u0442\u043e\u043b\u0435\u0442\u043d\u043e\u0439 \u0431\u0430\u0437\u0435 \u0444\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0445 \u0441\u0438\u043b, \u0430 \u0437\u0430\u0442\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%80%D1%80%D0%BE%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%BA%D1%82_%D0%B2_%D0%9A%D0%B8%D0%B7%D0%BB%D1%8F%D1%80%D0%B5_(1996)\" class=\"mw-redirect\" title=\"\u0422\u0435\u0440\u0440\u043e\u0440\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0430\u043a\u0442 \u0432 \u041a\u0438\u0437\u043b\u044f\u0440\u0435 (1996)\">\u0437\u0430\u0445\u0432\u0430\u0442\u0438\u043b\u0430 \u0431\u043e\u043b\u044c\u043d\u0438\u0446\u0443 \u0432 \u041a\u0438\u0437\u043b\u044f\u0440\u0435<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2001_%D0%B3%D0%BE%D0%B4\" title=\"2001 \u0433\u043e\u0434\">2001<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432\u044b\u0445\u043e\u0434 \u0432 \u0441\u0432\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BA%D0%B8%D0%BF%D0%B5%D0%B4%D0%B8%D1%8F\" title=\"\u0412\u0438\u043a\u0438\u043f\u0435\u0434\u0438\u044f\">Wikipedia<\/a> \u043a\u0430\u043a \u0447\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%83%D0%BF%D0%B5%D0%B4%D0%B8%D1%8F\" title=\"\u041d\u0443\u043f\u0435\u0434\u0438\u044f\">\u00ab\u041d\u0443\u043f\u0435\u0434\u0438\u0438\u00bb<\/a>. \u0427\u0435\u0440\u0435\u0437 5 \u0434\u043d\u0435\u0439 Wikipedia \u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0442\u0441\u044f \u0441\u0430\u043c\u043e\u0441\u0442\u043e\u044f\u0442\u0435\u043b\u044c\u043d\u044b\u043c \u0441\u0430\u0439\u0442\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2010_%D0%B3%D0%BE%D0%B4\" title=\"2010 \u0433\u043e\u0434\">2010<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0424\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u0438<\/a> \u0432\u0432\u0435\u0434\u0451\u043d \u043d\u043e\u0432\u044b\u0439 \u0432\u0438\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B3%D0%BE%D0%BB%D0%BE%D0%B2%D0%BD%D0%BE%D0%B5_%D0%BD%D0%B0%D0%BA%D0%B0%D0%B7%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0423\u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0435 \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u0435\">\u0443\u0433\u043e\u043b\u043e\u0432\u043d\u043e\u0433\u043e \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u044f<\/a>&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%BE%D0%BC%D0%B0%D1%88%D0%BD%D0%B8%D0%B9_%D0%B0%D1%80%D0%B5%D1%81%D1%82\" title=\"\u0414\u043e\u043c\u0430\u0448\u043d\u0438\u0439 \u0430\u0440\u0435\u0441\u0442\">\u0434\u043e\u043c\u0430\u0448\u043d\u0438\u0439 \u0430\u0440\u0435\u0441\u0442<\/a>\u00bb .<\/li><\/ul><h2>"}